INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "アヤネ", 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 102301, 24001, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 2.21, "アヤネ", 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 102301, 24002, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "アヤネ", 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 102301, 24003, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 1.99, "アサヒ", 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 192201, 24004, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 2.21, "アサヒ", 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 192201, 24005, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 3.33, "アサヒ", 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 192201, 24006, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "部員３", 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 192301, 24007, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 2.68, "部員３", 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 192301, 24008, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "部員３", 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 192301, 24009, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "", 501, "やった！", 192501, 24010, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "", 502, "勝ったよ！", 192501, 24011, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "", 503, "いい調子！", 192501, 24012, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 6, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 5.33, "ミサト", 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 113501, 24013, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 6.85, "ミサト", 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 113501, 24014, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 3.0, "ミサト", 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113501, 24015, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 6.11, "ダイチ", 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 192401, 24016, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 6.75, "ダイチ", 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 192401, 24017, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "ダイチ", 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 192401, 24018, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 4.52, "ハツネ", 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 113401, 24019, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 3.89, "ハツネ", 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 113401, 24020, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 13.49, "ハツネ", 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 113401, 24021, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 3.17, "カヤ", 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 106501, 24022, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 4.42, "カヤ", 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 106501, 24023, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 6, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 2.89, "カヤ", 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 106501, 24024, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 4, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 3.71, "アヤネ", 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 102301, 24025, 3);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 5.1, "アサヒ", 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 192201, 24026, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 4.34, "部員３", 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 192301, 24027, 3);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "", 521, "いい勝負だったよ\nまたやろうね", 192501, 24028, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 5.62, "ミサト", 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 113501, 24029, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 9.58, "ミサト", 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 113501, 24030, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "ミサト", 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 113501, 24031, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, 10046, 0.0, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 9.13, "ミサト", 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 113501, 24032, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, 10046, 0.0, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 8.27, "ミサト", 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 113501, 24033, 2);
